export async function getSeedData() {
  const promises = data.map((entry) => new Promise((resolve) => {
    const { imageURI } = entry;
    const img = new Image();
    const canvas = document.createElement('canvas');
    const context = canvas.getContext('2d') as CanvasRenderingContext2D;

    img.height = 25;
    img.width = 25;
    img.src = imageURI;
    canvas.width = 25;
    canvas.height = 25;

    img.addEventListener('load', () => {
      context.drawImage(img, 0, 0);
      entry.imageData = context.getImageData(0, 0, 25, 25);

      resolve(entry);
    })
  }));

  return Promise.all(promises);
}
